CREATE DATABASE seismic;

use seismic;

CREATE TABLE `catalog`(
    `event_id` INT(5) NOT NULL AUTO_INCREMENT,
    `time_event` VARCHAR(255) NOT NULL,
    `latitude` VARCHAR(255) NOT NULL,
    `longitude` VARCHAR(255) NOT NULL,
    `depth` VARCHAR(100) NOT NULL,
    `mag` VARCHAR(5) NOT NULL,
    `magType` VARCHAR(7) NOT NULL,
    PRIMARY KEY(`event_id`)
) ENGINE = InnoDB;



CREATE DATABASE deliveryorder;

CREATE TABLE `order`(
    `id` INT(5) NOT NULL AUTO_INCREMENT,
    `full_name` VARCHAR(255) NOT NULL,
    `address1` VARCHAR(255) NOT NULL,
    `address2` VARCHAR(255) NULL,
    `city` VARCHAR(100) NOT NULL,
    `state` VARCHAR(5) NOT NULL,
    `zip` VARCHAR(7) NOT NULL,
    `country` VARCHAR(255) NOT NULL,
    `phonenum` VARCHAR(20) NOT NULL,
    `partipate` BOOLEAN NULL,
    `item` BOOLEAN NULL,
    PRIMARY KEY(`id`)
) ENGINE = InnoDB;

